// This routine creates a fillet between two arbitrary shapes. // It works by expanding each shape by some distance and then creating a very thin shell around these expanded shapes. These two shells are then intersected to give one point along the fillet. The distances are chosen so that, for a two shapes that intersect under right angle, these intersection points lie on a quarter circle, with fn_fillet=16 faces.<br />
// The hull() command is then used to hull two adjacent intersection points together, thus creating the fillet.<br />
// This method has two side effects:<br />
// The fillet is not flush with the two shapes but sticks out by a small amount of dr=0.005, the thickness of the shells used to create the intersection points.<br />
// secondly, this routine creates a bulge around places were the two original shapes overlap. As illustrated in example 5 and example 6. This excess budge needs to be trimmed by hand.<br />
// Sometimes it is also possible to avoid this excess bulge by smart choice of the shapes, any excess fillet needs to be then blocked out by a third shape. This is illustrated in example 7.<br />
//<br />
// The form of the fillet is only circular in shape for the intersection of straight shapes under a perpenticular angle. If the edge of the shapes is not straight (e.g. fillet between two circles) the fillet is not quiet circular in shape and has a different (approximated) fillet radius than specified. For straight edge shapes under an arbitrary angle a similar effect occurs.<br />
//<br />
// The routine fillet_display() displays the two original shapes in red and green. They are translated by 0.01 in z-direction to avoid z-buffer fighting of the display with F5. This displacement in z-direction does not affect the result of F6, as F6 is purely a 2-dimentional result. The fillet is displayed in yellow(ish).<br />
//<br />
// The parameter fn_mink=16  gives the roundness of the circle that is used to expand the shapes and to create the shells. Increasing it will lead to very long computation times. It can be set as low as 4 (or even 3) to save on computation time, but will then result in slightly asymmetric fillets.<br />
//<br />
// The parameter dr=0.005 gives the thickness of the shells around the expanded shapes. If one sets this parameter to even smaller numbers, then the there is no resulting intersection calculated between the shells and no fillet is generated at all.<br />
//<br />
//The computaional time inceases drasticcally (exponentially?) with the number of facets of the shapes. One remedy would be to replace the expand and shell routines. For example the expand routine could be done by shifting the shape repeatatly by dr, but each time in a slightly different direction, union all shifted shapes together.<br />
//<br />
//This work was inspired by the excellent write-up on fillets by Cake Baby in <a rel="nofollow" href="http://sozvyezdami.wordpress.com/2013/04/10/3d-fillet-algorithm-prototype" >http://sozvyezdami.wordpress.com/2013/04/10/3d-fillet-algorithm-prototype</a> .
